"use client";

import React from "react";
import {
  CommandDialog,
  CommandEmpty,
  CommandGroup,
  CommandInput,
  CommandItem,
  CommandList,
  CommandSeparator,
  CommandShortcut,
} from "@/components/ui/command";
import {
  mdiCalendarBlankOutline,
  mdiEmoticonHappyOutline,
  mdiAccountOutline,
  mdiCalculatorVariantOutline,
  mdiCreditCardOutline,
  mdiCogOutline,
} from "@mdi/js";
import { Icon } from "@/lib/icon";

export default function DefaultDemo() {
  const [open, setOpen] = React.useState(false);

  React.useEffect(() => {
    const down = (e: KeyboardEvent) => {
      if (e.key === "j" && (e.metaKey || e.ctrlKey)) {
        e.preventDefault();
        setOpen((open) => !open);
      }
    };
    document.addEventListener("keydown", down);
    return () => document.removeEventListener("keydown", down);
  }, []);

  return (
    <div id="command-wrapper">
      <div id="command-trigger-wrapper" className="flex rounded-t-md bg-body-bg">
        <>
          <p id="command-trigger-text" className="text-muted-foreground text-sm">
            Press{" "}
            <kbd id="command-trigger-kbd" className="bg-muted text-muted-foreground pointer-events-none inline-flex h-5 items-center gap-1 rounded border px-1.5 font-mono text-[10px] font-medium opacity-100 select-none">
              <span className="text-xs">⌘</span>J
            </kbd>
          </p>
          <CommandDialog id="command-dialog" open={open} onOpenChange={setOpen}>
            <CommandInput id="command-input" placeholder="Type a command or search..." />
            <CommandList id="command-list">
              <CommandEmpty id="command-empty">No results found.</CommandEmpty>
              <CommandGroup id="command-group-suggestions" heading="Suggestions">
                <CommandItem id="command-item-calendar">
                  <Icon path={mdiCalendarBlankOutline} />
                  <span>Calendar</span>
                </CommandItem>
                <CommandItem id="command-item-emoji">
                  <Icon path={mdiEmoticonHappyOutline} />
                  <span>Search Emoji</span>
                </CommandItem>
                <CommandItem id="command-item-calculator">
                  <Icon path={mdiCalculatorVariantOutline} />
                  <span>Calculator</span>
                </CommandItem>
              </CommandGroup>
              <CommandSeparator id="command-separator" />
              <CommandGroup id="command-group-settings" heading="Settings">
                <CommandItem id="command-item-profile">
                  <Icon path={mdiAccountOutline} />
                  <span>Profile</span>
                  <CommandShortcut>⌘P</CommandShortcut>
                </CommandItem>
                <CommandItem id="command-item-billing">
                  <Icon path={mdiCreditCardOutline} />
                  <span>Billing</span>
                  <CommandShortcut>⌘B</CommandShortcut>
                </CommandItem>
                <CommandItem id="command-item-settings">
                  <Icon path={mdiCogOutline} />

                  <span>Settings</span>
                  <CommandShortcut>⌘S</CommandShortcut>
                </CommandItem>
              </CommandGroup>
            </CommandList>
          </CommandDialog>
        </>
      </div>
    </div>
  );
}
